export const questions = [
  {
    questionText: "что такое css?",
    answerOptions: [
      { text: "какое-то язык програмирование", isCorrect: false },
      { text: "Это фудбол", isCorrect: false },
      {
        text: "По сути — язык, который отвечает за описание внешнего вида HTML-документа.",
        isCorrect: true,
      },
      { text: "css это и есть java script", isCorrect: false },
    ],
  },
  {
    text: " Что такое react?",
    answerOptions: [
      { text: " Это язык програмирования css ", isCorrect: false },
      {
        text: "это популярная библиотека языка программирования Javascript",
        isCorrect: true,
      },
      { text: "react это елемент HTML", isCorrect: false },
      { text: "react это БОКС ;)", isCorrect: false },
    ],
  },
  {
    questionText: "Что такое Виртуальная DOM? ",
    answerOptions: [
      {
        text: "Виртуальный DOM (VDOM) — это концепция программирования, в которой идеальное или «виртуальное» представление пользовательского интерфейса хранится в памяти и синхронизируется с «настоящим» DOM при помощи библиотеки, такой как ReactDOM.",
        isCorrect: true,
      },
      {
        text: "программная платформа, основанная на движке V8 (компилирующем JavaScript в машинный код),",
        isCorrect: false,
      },
      {
        text: "система управления версиями с распределенной архитектурой",
        isCorrect: false,
      },
